import React from 'react';
import logo from '../assets/logo.png'; // Make sure logo.png exists in src/assets

export default function Navbar() {
  const handleNavClick = (e) => {
    e.preventDefault();
    const href = e.target.getAttribute('href');
    if (href && href !== '#') {
      // Custom navigation logic, or integrate with router
      alert(`Navigate to ${href}`); // Replace this with real logic
    }
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={logo} alt="Wings Cafe Logo" className="logo-img" />
        <span className="brand-name">Wings Cafe</span>
      </div>
      <ul className="navbar-links">
        <li><a href="/dashboard" onClick={handleNavClick}>Dashboard</a></li>
        <li><a href="/products" onClick={handleNavClick}>Products</a></li>
        <li><a href="/add-product" onClick={handleNavClick}>Add Product</a></li>
        <li><a href="/settings" onClick={handleNavClick}>Settings</a></li>
      </ul>
    </nav>
  );
}
